// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LandingPage from './pages/LandingPage';
import ClientAuth from './pages/CAuth';
import ClientDashboard from './pages/CDashboard';
import DrugBooking from './pages/CBooking';
import ClientProfile from './pages/CProfile';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/client/login" element={<CAuth />} />
        <Route path="/client/dashboard" element={<ClientDashboard />} />
        <Route path="/client/book" element={<DrugBooking />} />
        <Route path="/client/profile" element={<ClientProfile />} />
        <Route path="/client/home" element={<ClientDashboard />} />
        <Route path="/client/book/:drugId" element={<DrugBooking />} />
      </Routes>
    </Router>
  );
};

export default App;
